4本のストラップで身体をホールドする4ポイントタイプ。4点すべてのストラップが簡単に外せるクイックリリース機能をもつターン式バックルを採用し、緊急事態の時にはバックルのレバー操作だけで簡単にバックルからストラップが外せます。スパルコ社のバックルの特徴はレバーが飛び出ていませんので、ハーネス使用時にレバーがジャマにならないようにしています。 <br><br>●規格：FIA公認 ●右座席用（ジャパンエディション） ●ベルト幅：肩部 3インチ/腰部 3インチ ●アイボルトエンドタイプ ●カラー：ブラック<br><br>※実際の製品カラーにつきましては、掲載写真と多少異なる場合がございます。また製品改良のため、予告なく仕様変更となる場合がございますので、予めご了承ください。 <br><br>対応車種： 汎用品 <br><br>車検対応品<br><br>インテリア/シートベルト<tr><td colspan="2">
